INSERT INTO `dr_types` (`dr_types_id`, `dr_types_title`, `dr_types_desc`, `dr_types_image`) VALUES
(1, 'Pediatricians', 'They care for children from birth to young adulthood. Some pediatricians specialize in pre-teens and teens, child abuse, or children\'s developmental issues.', 'baby.png'),
(2, 'Dentist', 'A dentist, also known as a dental surgeon, is a surgeon who specializes in dentistry, the diagnosis, prevention, and treatment of diseases and conditions of the oral cavity. The dentist\'s supporting team aids in providing oral health services. The dental team includes dental assistants, dental hygienists, dental technicians, and sometimes dental therapists.', 'dentist.png'),
(3, 'Ophthalmologists', 'You call them eye doctors. They can prescribe glasses or contact lenses and diagnose and treat diseases like glaucoma. Unlike optometrists, they?re medical doctors who can treat every kind of eye condition as well as operate on the eyes', 'eye.png'),
(4, 'Gynecologists', 'Often called OB/GYNs, these doctors focus on women\'s health, including pregnancy and childbirth. They do Pap smears, pelvic exams, and pregnancy checkups. OB/GYNs are trained in both areas. But some of them may focus on women\'s reproductive health (gynecologists), and others specialize in caring for pregnant women (obstetricians).', 'gync.png'),
(5, 'Cardiologists', 'They?re experts on the?heart?and?blood?vessels. You might see them for?heart failure, a?heart attack,?high blood pressure, or an?irregular heartbeat.', 'heart.png'),
(6, 'Physicians', 'They care for the whole family, including children, adults, and the elderly. They do routine checkups and screening tests, give you flu and immunization shots, and manage diabetes and other ongoing medical conditions.', 'physician.png'),
(7, 'Surgeons', 'These doctors can operate on all parts of your body. They can take out tumors, appendices, or gallbladders and repair hernias. Many surgeons have subspecialties, like cancer, hand, or vascular surgery.', 'surgeon.png'),
(8, 'Colon and Rectal Surgeons', 'You would see these doctors for problems with your small intestine, colon, and bottom. They can treat colon cancer, hemorrhoids, and inflammatory bowel disease. They also can do a colonoscopy and other tests for colon cancer', 'null'),
(9, 'Critical Care Medicine Specialists', 'They care for people who are critically ill or injured. You might see them if your heart or other organs are failing or if you?ve been in an accident.', 'null'),
(10, 'Dermatologists', 'Have problems with your skin, hair, nails? Do you have moles, scars, acne, or skin allergies? Dermatologists can help.', 'epidermis.png'),
(11, 'Endocrinologists', 'These are experts on hormones and metabolism. They can treat conditions like diabetes, thyroid problems, infertility, and calcium and bone disorders.', 'null'),
(12, 'Gastroenterologists', 'They?re specialists in digestive organs, including the stomach, bowels, pancreas, liver, and gallbladder. You might see them for abdominal pain, ulcers, diarrhea, jaundice, or cancers in your digestive organs.', 'null'),
(13, 'Geriatric Medicine Specialists', 'These doctors care for the elderly. They can treat people in their homes, doctors\' offices, nursing homes, assisted-living centers, and hospitals.', 'null'),
(14, 'Hematologists', 'These are specialists in diseases of the blood, spleen, and lymph glands, like sickle cell disease, anemia, hemophilia, and leukemia.', 'null'),
(15, 'Medical Geneticists', 'They diagnose and treat hereditary disorders passed down from parents to children. These doctors may also offer genetic counseling and screening tests.', 'null'),
(16, 'Nephrologists', 'They treat kidney diseases as well as high blood pressure and fluid and mineral imbalances linked to kidney disease.', 'null'),
(17, 'Neurologists', 'These are specialists in the nervous system, which includes the brain, spinal cord, and nerves. They treat strokes, brain and spinal tumors, epilepsy, Parkinson\'s disease, and Alzheimer\'s disease.', 'thinking.png'),
(18, 'Oncologists', 'These internists are cancer specialists. They do chemotherapy treatments and often work with radiation oncologists and surgeons to care for someone with cancer', 'null'),
(19, 'Physiatrists', 'These specialists in physical medicine and rehabilitation treat neck or back pain and sports or spinal cord injuries as well as other disabilities caused by accidents or diseases.', 'null'),
(20, 'Psychiatrists', 'These doctors work with people with mental, emotional, or addictive disorders. They can diagnose and treat depression, schizophrenia, substance abuse, anxiety disorders, and sexual and gender identity issues. Some psychiatrists focus on children, adolescents, or the elderly.', 'null'),
(21, 'Urologists', 'These are surgeons who care for men and women for problems in the urinary tract, like a leaky bladder. They also treat male infertility and do prostate exams.', 'null'),
(22, 'Anesthesiologists', 'These doctors give you drugs to numb your pain or to put you under during surgery, childbirth, or other procedures. They monitor your vital signs while you?re under anesthesia.', 'injection.png'),
(23, 'Immunologists', 'They treat immune system disorders such as asthma, eczema, food allergies, insect sting allergies, and some autoimmune diseases.', 'null'),
(24, 'Orthopedic', 'Orthopedic surgery or orthopedics, also spelled orthopaedics, is the branch of surgery concerned with conditions involving the musculoskeletal system. Orthopedic surgeons use both surgical and nonsurgical means to treat musculoskeletal trauma, spine diseases, sports injuries, degenerative diseases, infections, tumors, and congenital disorders.', 'orthopedics.png');
